import React, { Component } from 'react'
import './ChatroomList.scss';

class ChatroomList extends Component {
    constructor(props) {
        super(props);
    }
    render() { 
        const rooms = this.props.chatrooms?.map((val, index) => (
            <li>
                <button value={val} onClick={this.props.switchChatroom}></button>
            </li>
        ));
        return (
            <div className="ChatroomList">
                {rooms}
            </div>
        );
    }
}

export default ChatroomList;
